import React from 'react'
import './index.css'
import './pic/logo.png'


const nav = () => {
    return (
        //nav bar mx auto to make in the center 
        <nav className='relative container mx-auto p-6'>
            {/* flex container */}
            <div className="flex items-center justify-between">
                {/* logo */}
                <div className="pt-2">
                    <img className='h-20' src={require("./pic/logo.png")} />
                </div>
                {/* menu items */}
                <div className="flex space-x-6">
                    <a href="">Home</a>
                    <a href="">Explore</a>
                    <a href="">Artist</a>
                    <a href="">Myprofile</a>
                </div>


            </div>

        </nav>
    )
}

export default nav
